import React, { useEffect, useState } from 'react';
import { retailerAPI, productAPI } from '../services/api';

const RetailerDashboard = () => {
  const [farmers, setFarmers] = useState([]);
  const [selectedFarmerId, setSelectedFarmerId] = useState(null);
  const [products, setProducts] = useState([]);

  // Fetch all farmers
  useEffect(() => {
    const fetchFarmers = async () => {
      try {
        const response = await retailerAPI.getAllFarmers();
        setFarmers(response.data);
      } catch (error) {
        console.error("Error fetching farmers:", error);
      }
    };
    fetchFarmers();
  }, []);

  // Fetch products when a farmer is selected
  const handleViewProducts = async (farmerId) => {
    try {
      setSelectedFarmerId(farmerId);
      const response = await productAPI.getProductsByFarmer(farmerId);
      setProducts(response.data);
    } catch (error) {
      console.error("Error fetching products:", error);
    }
  };

  return (
    <div className="dashboard-container">
      <h2>Retailer Dashboard</h2>

      <h3>Registered Farmers</h3>
      <table border="1" cellPadding="8" style={{ width: "100%", marginBottom: "20px" }}>
        <thead>
          <tr>
            <th>Name</th><th>Email</th><th>Phone</th><th>Address</th><th>Action</th>
          </tr>
        </thead>
        <tbody>
          {farmers.map((farmer) => (
            <tr key={farmer.id}>
              <td>{farmer.name}</td>
              <td>{farmer.email}</td>
              <td>{farmer.phone}</td>
              <td>{farmer.address}</td>
              <td>
                <button onClick={() => handleViewProducts(farmer.id)}>
                  View Products
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      {selectedFarmerId && (
        <>
          <h3>Products by Farmer ID: {selectedFarmerId}</h3>
          {products.length > 0 ? (
            <table border="1" cellPadding="8" style={{ width: "100%" }}>
              <thead>
                <tr>
                  <th>Product Name</th>
                  <th>Category</th>
                  <th>Price</th>
                  <th>Quantity</th>
                  <th>Description</th>
                </tr>
              </thead>
              <tbody>
                {products.map((p) => (
                  <tr key={p.id}>
                    <td>{p.name}</td>
                    <td>{p.category}</td>
                    <td>{p.price}</td>
                    <td>{p.quantity}</td>
                    <td>{p.description}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          ) : (
            <p>No products found for this farmer.</p>
          )}
        </>
      )}
    </div>
  );
};

export default RetailerDashboard;
